function Home(){
    return(
        <div class="home">
            <div class="home-img">
                <img src='https://res.cloudinary.com/dvra8rj4n/image/upload/v1705159558/NITSX/s8e6cjvpjyvgocbtbjpt.svg'></img>
            </div>
            <div class="home-info">
                <div class="aboutself">
                    <h1>Reach out to me!</h1>
                </div>
            </div>
        </div>
    )
}
export default Home;
